import React from "react";
import { Route, Switch } from "react-router-dom";

import HomePage from "./pages/homepage/homepage.component.jsx";
import "./App.css";

const HatsPage = () => {
  return (
    <div>
      <h1>HATS PAGE</h1>
    </div>
  );
};

function App() {
  return (
    <div>
      <Route exact path={"/"} component={HomePage} />
      <Route exact path={"/hats"} component={HatsPage} />
    </div>
  );
}

export default App;
